script: |
  super -f text -I q11424.spq | sort > q11424.out

inputs:
  - name: q11424.spq
    data: |
      SELECT - col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 / - col2 + - + 97 NOT IN ( - col0, col1 * - - col2 * - 86, - col2 * - + 23 );
  - name: tab2

outputs:
  - name: q11424.out
    data: |
      -51
      -67
      -77
